import React, { useEffect, useState } from 'react';
import './memoryjar.css';
import axios from 'axios';
const MemoryJar=({name})=>{

    const[posts,setPosts]=useState([]);

    useEffect(()=>{
        axios.get(`http://localhost:5000/posts/${name}`)
        .then(result=>{
            setPosts(result.data);
            console.log(posts)
        })
      },[])

    return(
        <div className="jar-container">
           {
               posts && posts.map(post=>(
                    <div className="m-jar">
                        <img className="jar-image" src="./images/AA11EC18-8AC2-4081-A819-7A69CBE46D2D.jpeg" />
                        <h3>{post.title}</h3>
                        <p>{post.story.substr(0,20)}...</p>
                    </div>
               ))
           }
        </div>
    );
}

export default MemoryJar;
